import React, { useState } from "react";
import { Button,Spinner } from "react-bootstrap";
import { useNavigate } from "react-router";
import { useUserAuth } from "../context/UserAuthContext";
import axios from "axios";
import { GoogleGenerativeAI } from "@google/generative-ai";
import MDEditor from "@uiw/react-md-editor";
import "./Home.css";

const Home = () => {
  const { logOut, user } = useUserAuth();
  const navigate = useNavigate();
  const [showSidebar, setShowSidebar] = useState(true);
  const [inputText, setInputText] = useState("");
  const [generatedText, setGeneratedText] = useState("");
  const [isLoading, setIsLoading] = useState(false); 

  const handleLogout = async () => {
    try {
      await logOut();
      navigate("/");
    } catch (error) {
      console.log(error.message);
    }
  };

  const toggleSidebar = () => {
    setShowSidebar(!showSidebar);
  };

  const handleInputChange = (e) => {
    setInputText(e.target.value);
  };

  const handleGenerateText = async () => {
    setIsLoading(true);
    try {
      const response = await axios({
        method: "post",
        url: `https://generativelanguage.googleapis.com/v1beta/models/gemini-1.5-flash-latest:generateContent?key=AIzaSyCUvrqdm437X37xPrwWbvqXqQ1QDbnSzzI`,
        data: {
          prompt: inputText,
        },
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log("API response:", response);

      setGeneratedText(response.data.generatedContent);
    } catch (error) {
      console.error("Error generating text:", error);
    } finally {
      setIsLoading(false);
    }
    console.log(generatedText);
  };

  const API_KEY = process.env.REACT_APP_API_KEY;
  const genAI = new GoogleGenerativeAI(API_KEY);
  const model = genAI.getGenerativeModel({ model: "gemini-pro" });

  return (
    <div className="d-flex">
      <div className={`sidebar ${showSidebar ? "show" : "hide"}`}>
        <nav>
          <ul>
            <li><a href="home" style={{ fontSize: "24px" }}>EXPL<span style={{ fontWeight: "bold" }}>AI</span>NIFY</a></li>
            <li><a href="signup">Sign Up </a></li>
            <li><a href="/">Log In</a></li>
            <li><a href="home">Home</a></li>
            <li><Button variant="primary" onClick={handleLogout}>
              Log out
            </Button></li>
          </ul>
        </nav>
      </div>
      <Button variant="secondary" onClick={toggleSidebar} className="toggle-btn">
        {showSidebar ? "<<" : ">>"}
      </Button>
      <div className="content flex-grow-1 p-4">
        <div className="p-4 box mt-3 text-center">
          <h1 style={{ fontSize: "32px" }}>Welcome</h1>
          <p style={{ fontSize: "18px" }}>{user && user.email}</p>
        </div>
        <div className="mt-4">
          <input
            type="text"
            value={inputText}
            onChange={handleInputChange}
            placeholder="Enter text to generate"
            className="form-control mb-2"
          />
          <Button variant="primary" onClick={handleGenerateText} disabled={isLoading}>
        {isLoading ? <Spinner as="span" animation="border" size="sm" role="status" aria-hidden="true" /> : "Generate Text"}
      </Button>
        </div>
        {generatedText && (
          <div className="mt-4 p-4 box">
            <h3>Generated Text:</h3>
            <p>{generatedText}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Home;
